using iox_sample_app.Requests;
using iox_sample_app.Requests.Enums;
using iox_sample_app.Services;
using Microsoft.AspNetCore.Mvc;
using System;
using System.Collections.Generic;
using System.Threading.Tasks;

namespace iox_sample_app.Controllers
{
    public class DocumentsController : ControllerBase
    {
        private readonly IAPIService _apiService;
        public DocumentsController(IAPIService apiService)
        {
            _apiService = apiService ?? throw new ArgumentNullException(nameof(apiService));
        }

        //This request creates a documents upload instruction
        [HttpGet("UploadDocuments")]
        public async Task<IActionResult> UploadDocuments()
        {
            try
            {
                //PLEASE NOTE THE REQUEST'S DATA IS TEST DATA AND SHOULD NOT BE POSTED TO THE API
                var request = new DocumentsRequest()
                {
                    referenceId = "text1",
                    accountReference = "YuEvSNTSn9",
                    documents = new List<DocumentItem>
                    {
                        new DocumentItem()
                        {
                            document = "data:application/pdf;base64,",
                            documentType = (int) DocumentTypes.ProofOfAddress, // Proof of address
                            expires = true,
                            expiryDate = new DateTime(2023, 5, 3),
                            documentOwnerIdentification = "XfaQxVKfT8",
                            ownerType   = (int) DocumentOwnerType.Brn // BRN
                        }
                    }
                };
                var response = await _apiService.Post(request, RequestTypes.UploadDocuments);

                if (response.status == "Success")
                    return Ok(response);
                else
                    return BadRequest(response.errors);
            }
            catch (Exception e)
            {
                return BadRequest();
            }
        }
    }
}
